class App extends Component {
constructor(props) {
    super(props);
    this.state = {
      posts: []
    }
  }render() {
    return (
    <Routes>
      <Route exact path="/" element={<Home />} />
      <Route path="/about" element={<About />} />
      <Route
          path="/contact"
          element={<Contact />}
      />
      <Route path="/blogs" element={<Blogs />} />
      <Route
          path="/sign-up"
          element={<SignUp />}
      />
  </Routes>
    );
  }
}
export default App;
